    <div className="splash-pg">
      <img src={dessert} style={{ width: "30%" }}>Welcome to MenuTube</img>
      <h1 className="splash-welcome" style={{ fontSize: "25px" }}>
        Welcome to MenuTube
      </h1>
    </div>
  );
};

export default SplashPage;
